import React from "react";
import { Box, AppBar, Toolbar, Typography } from "@mui/material";

const Navbar = () => {
  return;
  <Box sx={{ flexFlow: 1 }}>
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h4"> Where in the world? </Typography>
      </Toolbar>
    </AppBar>
  </Box>;
};

export default Navbar;
